import React from "react";
import { Link, useNavigate } from "react-router-dom";

export default function Navbar({ userId, setUserId }) {
  const navigate = useNavigate();

  const handleLogout = () => {
    setUserId(null);
    navigate("/");
  };

  return (
    <nav className="navbar">
      <div className="nav-left">
        <Link to="/"><strong>CustomHobby</strong></Link>
        <Link to="/main">메인</Link>
        <Link to="/recommend">추천</Link>
        <Link to="/category">카테고리</Link>
      </div>
      <div className="nav-right">
        {userId ? (
          <>
            <Link to="/mypage">내정보</Link>
            <button onClick={handleLogout} className="link-button">로그아웃</button>
          </>
        ) : (
          <>
            <Link to="/login" onClick={(e)=>{e.preventDefault(); navigate("/");}}>로그인</Link>
            <Link to="/register">회원가입</Link>
          </>
        )}
      </div>
    </nav>
  );
}
